const Navbar = () => {
    return(
        <nav class="bg-red-900 relative">
            <h1 class=" text-3xl font-extrabold m-2 flex">ZETARIORS</h1>
              <ul class="center flex">
                <li class="text-white m-2"><a href="#">Home</a></li>
                <li class="text-white m-2"><a href="#">Gallery</a></li>
                <li class="text-white m-2"><a href="#">Contact</a></li>
              </ul>
        </nav>
    )
}



export default Navbar;
